import React , {useState} from 'react';
import HeroBanner from "../Components/HeroBanner"
import Excercises from "../Components/Excercises"
import SearchExcercises from "../Components/SearchExcercises"


const Home = () => {
  return (
    <div className='body'>
      <HeroBanner/>
      <Excercises/>
      <SearchExcercises/>
    </div>
  )
}

export default Home
